import { Injectable } from '@angular/core';
import { InfectionOsteomyeliteAigue } from '../models/InfectionOsteomyeliteAigue';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class InfostService {

  
  private apiUrl = 'https://localhost:7129/api/InfectionOsteomyeliteAigues';

  constructor(private http: HttpClient) { }
  addost(InfectionOsteomyeliteAigue: InfectionOsteomyeliteAigue): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', InfectionOsteomyeliteAigue);

    return this.http.post<any>(`${this.apiUrl}/addost`, InfectionOsteomyeliteAigue, { observe: 'response' });
  }}
